import React from "react";
import Img from "../slike/pattern.png";

const Projects = () => {
  const style = {
    backgroundImage: `url(${Img})`,
  };
  return (
    <div
      className="w-screen h-[calc(100%-70px)] absolute top-[70px] bg-red flex justify-center"
      style={style}
    >
      {" "}
      <div className="h-full w-[60%] bg-red flex justify-center "> </div>{" "}
    </div>
  );
};

export default Projects;
